import { Grid, Card, CardActionArea, CardMedia, CardContent, Typography } from "@mui/material";
import { useContext } from "react";
import { UserContext } from "./UserDataContext";

const image = {
    "5000" : "https://rossaprimavera.ru/static/files/e1b7973deeae.jpg",
    "1000" : "https://kollekcioner24.ru/image/catalog/20200426_114356.jpg",
    "500" : "https://coinsmoscow.ru/published/publicdata/COINSSR2WEBASYSTT/attachments/SC/products_pictures/23063-500r_2_enl.jpg",
    "100" : "https://cdn1.ozone.ru/s3/multimedia-m/6512337226.jpg",
    "10" : "https://proof.ru/upload/resize_cache/iblock/987/1500_1500_1/he8x3paesgra63yfc769ib948qcr66vd.jpg"
}

function Result () {
    const { allBank } = useContext(UserContext)

    return (
        <Grid component>
            {allBank.map(element => (
                <Grid item>
                    <Card>
                        <CardActionArea>
                            <CardMedia
                                component='img'
                                height="140"
                                image="/static/images/cards/contemplative-reptile.jpg"
                                alt="5000"
                            />
                            <CardContent>
                            <Typography gutterBottom variant="h5" component="div">
                                {'asd'}
                            </Typography>
                            </CardContent>
                        </CardActionArea>
                    </Card>  
                </Grid>
            ))}
        </Grid>
    )
}

export default Result;
